selector_to_html = {"a[href=\"#roadmap\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Roadmap<a class=\"headerlink\" href=\"#roadmap\" title=\"Link to this heading\">#</a></h2><p>For details on our planned features and future direction, please refer to our <a class=\"tippyAnchor reference external\" href=\"https://github.com/microsoft/TypeScript/wiki/Roadmap\">roadmap</a>.</p>", "a[href=\"#documentation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Documentation<a class=\"headerlink\" href=\"#documentation\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#contribute\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Contribute<a class=\"headerlink\" href=\"#contribute\" title=\"Link to this heading\">#</a></h2><p>There are many ways to <a class=\"tippyAnchor reference external\" href=\"https://github.com/microsoft/TypeScript/blob/main/CONTRIBUTING.md\">contribute</a> to TypeScript.</p>", "a[href=\"#typescript\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">TypeScript<a class=\"headerlink\" href=\"#typescript\" title=\"Link to this heading\">#</a></h1><p><a class=\"tippyAnchor reference external\" href=\"https://github.com/microsoft/TypeScript/actions?query=workflow%3ACI\"><img alt=\"GitHub Actions CI\" loading=\"lazy\" src=\"https://github.com/microsoft/TypeScript/workflows/CI/badge.svg\"/></a>\n<a class=\"tippyAnchor reference external\" href=\"https://www.npmjs.com/package/typescript\"><img alt=\"npm version\" loading=\"lazy\" src=\"https://badge.fury.io/js/typescript.svg\"/></a>\n<a class=\"tippyAnchor reference external\" href=\"https://www.npmjs.com/package/typescript\"><img alt=\"Downloads\" loading=\"lazy\" src=\"https://img.shields.io/npm/dm/typescript.svg\"/></a>\n<a class=\"tippyAnchor reference external\" href=\"https://securityscorecards.dev/viewer/?uri=github.com/microsoft/TypeScript\"><img alt=\"OpenSSF Scorecard\" loading=\"lazy\" src=\"https://api.securityscorecards.dev/projects/github.com/microsoft/TypeScript/badge\"/></a></p><p><a class=\"tippyAnchor reference external\" href=\"https://www.typescriptlang.org/\">TypeScript</a> is a language for application-scale JavaScript. TypeScript adds optional types to JavaScript that support tools for large-scale JavaScript applications for any browser, for any host, on any OS. TypeScript compiles to readable, standards-based JavaScript. Try it out at the <a class=\"tippyAnchor reference external\" href=\"https://www.typescriptlang.org/play/\">playground</a>, and stay up to date via <a class=\"tippyAnchor reference external\" href=\"https://blogs.msdn.microsoft.com/typescript\">our blog</a> and <a class=\"tippyAnchor reference external\" href=\"https://twitter.com/typescript\">Twitter account</a>.</p>", "a[href=\"#installing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Installing<a class=\"headerlink\" href=\"#installing\" title=\"Link to this heading\">#</a></h2><p>For the latest stable version:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
